class Lisor {
    static #lisorCounter = 0
    static #lisorGif = "data:image/gif;base64,"
    static #isRunning = false

    static start() {
        addEventListener('keyup', (e) => {
            if (this.#isRunning) {
                return;
            }

            if ((e.key === 'l' || e.key === 'L') && this.#lisorCounter === 0) {
                this.#lisorCounter++;
            } else if ((e.key === 'i' || e.key === 'I') && this.#lisorCounter === 1) {
                this.#lisorCounter++;
            } else if ((e.key === 's' || e.key === 'S') && this.#lisorCounter === 2) {
                this.#lisorCounter++;
            } else {
                this.#lisorCounter = 0;
            }

            if (this.#lisorCounter === 3) {
                this.#lisorCounter = 0;
                this.#showLisor();
            }
        });
    }

    static #showLisor() {
        this.#isRunning = true;
        let lisorImage = document.createElement('img');
        lisorImage.src = this.#lisorGif;
        lisorImage.style.position = 'fixed';
        lisorImage.style.bottom = '0';
        lisorImage.style.left = '-15dvw';
        lisorImage.style.zIndex = '1000';
        lisorImage.style.maxWidth = '15dvw';
        lisorImage.style.maxHeight = '10dvh';
        lisorImage.style.transition = `left ${window.innerWidth / 125}s`;
        lisorImage.style.transitionTimingFunction = 'linear';
        lisorImage.style.cursor = 'pointer';
        lisorImage.onclick = () => window.open('https://github.com/kyzelm', '_blank').focus();
        document.body.appendChild(lisorImage);
        setTimeout(() => {
            lisorImage.style.left = '100%';
            setTimeout(() => {
                lisorImage.remove();
                this.#isRunning = false;
            }, (window.innerWidth / 125) * 1000);
        }, 100);
    }
}

export default Lisor;